webpackJsonp([9356207272238],{401:function(a,o){a.exports={data:{site:{siteMetadata:{title:"MAC0215 Blog",author:"Victor Hugo M. Pinto"}},markdownRemark:{id:"/Users/victorhugo/BCC/mac0215-blog/src/pages/inferência-de-gênero/index.md absPath of file >>> MarkdownRemark",html:"<p>Em conversa com Renato, meu co-supervisor, sobre o campo “Gênero” das planilhas de inscritos das edições anteriores do HackathonUSP discutimos sobre a ausência de tal campo no formulário de inscrição, ou seja, a falta desse dado nas planilhas que temos.</p>\n<p>Atualmente, no processo de seleção do HackathonUSP é inferído o gênero dos incritos com base em seus nomes, logo para fins desta pesquisa criamos um campo “Gênero” nas planilhas que não possuiam tal coluna e vamos preencher-las manualmente de forma binária (Masculino ou Feminino) para simplificar a padronização dos dados e poder levar em consideração este importante campo na posterior análise.</p>",frontmatter:{title:"Inferência de Gênero",date:"September 12, 2018"}}},pathContext:{slug:"/inferência-de-gênero/",previous:{fields:{slug:"/dados-originais/"},frontmatter:{title:"Dados originais"}},next:{fields:{slug:"/padronização-de-campos-I/"},frontmatter:{title:"Padronização de campos (Pt. 1)"}}}}}});
